@extends('layouts.app')

@section('content')
    <form id="register" enctype="multipart/form-data">
        @csrf
        <div class="container">
            <div class="row" style="background: #fff;border: 5px solid #000; border-radius: 20px; padding:100px;">
                <div style="padding: 0 30px;">    
                    <h1>Be a <span style="color:#FF7100;">Guru</span></h1>
                    <h4>Lets earn and help learning.</h4>
                </div>
                <div class="col-12 col-lg-6">
                    <div style="padding: 0 20px;">
                        <div class="mb-3 mt-3">
                            <input type="text" name="name" class="form-control" placeholder="Full name" required style="background:#fff;border-radius: 20px; border: 3px solid #000;padding: 10px 15px;font-size: 12px;">
                        </div>
                        <div class="mb-5">
                            <input type="email" name="email" class="form-control" placeholder="E-mail address" required style="background:#fff;border-radius: 20px; border: 3px solid #000;padding: 10px 15px;font-size: 12px;">
                        </div>
                    </div>
                </div>
                <div class="col-12 col-lg-6">
                    <div class="mt-3" style="padding: 0 20px;">
                        <h6>Submit your CV or Credentials</h6>
                        <input type="file" name="file" id="file" />
                    </div>
                </div>
                <center>
                    <button type="submit" class="btn btn-success" style="background:#DB8B79;color:#000;padding: 5px 60px;border-color: #001333; border-width: 4px; border-radius: 20px; font-weight: bold; font-size: 15px;">Submit</button>
                </center>
            </div>

        </div>
    </form>
